          name: "Я, Эрл и умирающая девушка (2015)",
          info: "Грег - подросток, который увлекается постановкой и снимает любительские фильмы. Он посещает старшую школу и старается лишний раз не наживать себе врагов. Большого количества друзей у него нет, есть только коллега Эрл, разделяющий его интересы, с которым они смотрят и переснимают классические киноленты. Волей случая, Грег начинает тесно общаться с одноклассницей, тихой еврейской девочкой Рейчел, у которой обнаружена лейкемия. И в процессе общения случается так, что эти двое становятся незаменимыми друг для друга... Грег пытается оказать поддержку подруге, показывая свои фильмы.",
